import React, { useEffect, useState } from 'react';


function App(){

  const [num , setnum] = useState(0)
  const [nums , setnums] = useState(0)

  useEffect(function (){
    alert("I am Clicked");
  })

  function increment(){
    setnum(num + 1);
  }
  function increment2(){
    setnums(nums + 1);
  }


  return(
    <>
      <button onClick={increment}>Click me {num}</button>
      <button onClick={increment}>Click me {nums}</button>
    </>
  )
}

export default App;
